import '../index.css'

const ProductDetails = ({product}) => 
{
    return (
        <div>
            <h4>{product.name}</h4>
            <p><strong> Brand: </strong>{product.brand}</p>
            <p><strong> Category: </strong>{product.category}</p>
            <p><strong> Image: </strong>{product.image}</p>
        </div>
    )
}

export default ProductDetails
